import logo from './logo.svg';
import './App.css';
import TLACMap from './components/tlac-map.js';

function tlac() {
  return (
    <div className="App">
      <h1>Welcome to APA Dashboard!</h1>
      <TLACMap />
    </div>
  );
}

export default tlac;
